PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE m_story_side(
  id INTEGER NOT NULL,
  member_m_id INTEGER NOT NULL,
  card_m_id INTEGER NOT NULL,
  story_no INTEGER NOT NULL,
  title TEXT NOT NULL,
  scenario_script_asset_path TEXT NOT NULL,
  card_image_asset_path TEXT NOT NULL,
  story_side_color TEXT NOT NULL,
  display_order INTEGER NOT NULL,
  story_side_release_route INTEGER NOT NULL,
  PRIMARY KEY (id),
  UNIQUE (member_m_id, card_m_id, story_no),
  FOREIGN KEY (member_m_id) REFERENCES m_member(id),
  FOREIGN KEY (card_m_id) REFERENCES m_card(id)
);
COMMIT;
